//* 1) Создайте таблицу logs типа Archive. Пусть при каждом создании записи в таблицах users, catalogs и products в 
таблицу logs помещается время и дата создания записи, название таблицы, идентификатор первичного ключа и содержимое 
поля name.*//

DROP TABLE IF EXISTS logs;

CREATE TABLE logs (
	-- id SERIAL PRIMARY KEY,
	table_name VARCHAR (50),
	id_of_note BIGINT,
	created_at DATETIME DEFAULT NOW(),
	name_ VARCHAR (150)
) ENGINE=Archive;

DROP TRIGGER IF EXISTS for_users;

DELIMITER //

CREATE TRIGGER for_users AFTER INSERT ON users
FOR EACH ROW 
BEGIN
	INSERT INTO logs (table_name, id_of_note, created_at, name_) 
		SELECT 'users', u.id, u.created_at, u.name FROM users u
		ORDER BY u.id DESC 
		LIMIT 1;
END//

DELIMITER ;

INSERT INTO users (name) VALUES ('Peter'); -- Проверили триггер


DROP TRIGGER IF EXISTS for_catalogs;

DELIMITER //

CREATE TRIGGER for_catalogs AFTER INSERT ON catalogs
FOR EACH ROW 
BEGIN
	INSERT INTO logs (table_name, id_of_note, created_at, name_) 
		SELECT 'catalogs', c.id, NOW(), c.name FROM catalogs c
		ORDER BY c.id DESC 
		LIMIT 1;
END//

DELIMITER ;

INSERT INTO catalogs (name) VALUES 
	('Мониторы'),
	('Мыши');			-- Проверили триггер
	
DROP TRIGGER IF EXISTS for_products;

DELIMITER //

CREATE TRIGGER for_products AFTER INSERT ON products
FOR EACH ROW 
BEGIN
	INSERT INTO logs (table_name, id_of_note, created_at, name_) 
		SELECT 'products', p.id, p.created_at, p.name FROM products p
		ORDER BY p.id DESC 
		LIMIT 1;
END//

DELIMITER ;

